const apiURL = 'http://localhost:3000/stock';
export const fetchElectronicsData = async () => {
    try{
        const res=await fetch(apiURL).then(res=>res.json()).then(res=>console.log(res));
        if(!res.ok){
            throw new Error('Network Response Error');
        }
        const arr=await res.json().then(res=>console.log(res));
        return arr;
    }
    catch(error){
        throw new Error('API Response Error: '+error.message);
    }
};
